import React from 'react';

const Homepage = () => {
    return (
        <div className="container">
            <div className="row">
                <div className="col-2">

                    <button type="button" class="btn btn-primary">Primary</button>

                    <button type="button" class="btn btn-success">Success</button>
                </div>

            </div>
        </div>
    );
}

export default Homepage;
